import React from "react";
import PageTitleImage from "../components/PageTitleImage";
import ProductDetailSection from "../components/ProductDetailSection";

const ProductDetail = () => {
  return (
    <>
      <PageTitleImage />
      <ProductDetailSection />
    </>
  );
};

export default ProductDetail;
